var game;
var gameLoaded = false;
var createOnLoaded = false;
var num  = 0 
window.onload = function () {
    var gameConfig = {
        type: Phaser.AUTO,
        width: 512,
        height: 800,
        backgroundColor: 0x000000,
        scene: [playGame]
    };
    game = new Phaser.Game(gameConfig);
}

class playGame extends Phaser.Scene {

    constructor() {
        super("PlayGame");
    }

    preload() {
        if (gameLoaded) {
            return;
        }

        var pic_name = [],addFlag = false;
        
        for (var p1 in assets) {
            if (assets.hasOwnProperty(p1))
                pic_name.push(p1);
        }
        for (var i = 0; i < pic_name.length; i++) {
            this.textures.addBase64(pic_name[i], eval("assets." + pic_name[i]))
        }

        var imageCount = pic_name.length;
        var loadedCount = 0;
        this.textures.on('addtexture', function () {
            loadedCount++;
            if (imageCount == loadedCount) {
                gameLoaded = true;
                if (createOnLoaded) {
                    this.create();
                }
            }
        }, this);
    }

    create() {
        if (!gameLoaded) {
            createOnLoaded = true;
            return;
        }

        // var downloadBtn = this.add.sprite(game.config.width / 2, game.config.height / 2, 'btn_download')
        //     .setInteractive();

        // downloadBtn.on('pointerdown', function (pointer) {
        //     landingPage();
        // }, this);

        this.bg = this.add.image(0,0,'bg_n').setOrigin(0,0).setInteractive().on('pointerdown',function(pointer){
            var wrong = this.add.image(pointer.x, pointer.y, 'wrong');
            this.tweens.add({
                targets: [wrong],
                rotation: 0.15,
                duration: 100,
                callbackScope: this,
                onComplete: function(tween) {
                    this.tweens.add({
                        targets: [wrong],
                        rotation: -0.15,
                        duration: 100,
                        callbackScope: this,
                        onComplete: function(tween) {
                            wrong.destroy();
                        }
                    });
                }
            });
        },this)
        var a = this.add.image(227,289,'a').setAlpha(0.001).setInteractive().on('pointerdown',function(){
            this.a()
            a.off('pointerdown')
            a1.off('pointerdown')
        },this)
        var b = this.add.image(145,288,'b').setAlpha(0.001).setInteractive().on('pointerdown',function(){
            this.b()
            b.off('pointerdown')
            b1.off('pointerdown')
        },this)
        var c = this.add.image(238,97,'c').setScale(1.1,1.1).setAlpha(0.001).setInteractive().on('pointerdown',function(){
            this.c()
            c.off('pointerdown')
            c1.off('pointerdown')
        },this)
        var a1 = this.add.image(227,727,'a').setAlpha(0.001).setInteractive().on('pointerdown',function(){
            this.a()
            a.off('pointerdown')
            a1.off('pointerdown')
        },this)
        var b1 = this.add.image(145,727,'b').setAlpha(0.001).setInteractive().on('pointerdown',function(){
            this.b()
            b.off('pointerdown')
            b1.off('pointerdown')
        },this)
        var c1 = this.add.image(238,532,'c').setScale(1.1,1.1).setAlpha(0.001).setInteractive().on('pointerdown',function(){
            this.c()
            c.off('pointerdown')
            c1.off('pointerdown')
        },this)

        this.guide = this.add.image(145,288,'circle')
        this.guideScale()
        this.guideScaleBack()
        this.resize();
        window.addEventListener("resize", this.resize, false);
    }
    update(){
        if(num == 3){
            this.bg.off('pointerdown')
            setTimeout(() => {
                this.showWin()
            }, 1000);
            
            num = 0
        }
    }
    a () {
        var right1 = this.add.image(227,289,'right')
        var right2 = this.add.image(227,727,'right')
        this.guide.visible = 0
        num++
    }
    b () {
        var right1 = this.add.image(145,288,'right')
        var right2 = this.add.image(145,727,'right')
        this.guide.visible = 0
        num++
    }
    c () {
        var right1 = this.add.image(238,97,'right')
        var right2 = this.add.image(238,535,'right')
        this.guide.visible = 0
        num++
    }
    guideScale() {
        this.tweens.add({
            targets: [this.guide],
            scaleX: 1.2,
            scaleY: 1.2,
            duration: 400,
            callbackScope: this,
            onComplete: function(tween) {
                this.guideScaleBack();
            }
        });
    }

    guideScaleBack() {
        this.tweens.add({
            targets: [this.guide],
            scaleX: 1,
            scaleY: 1,
            duration: 500,
            callbackScope: this,
            onComplete: function(tween) {
                this.guideScale();
            }
        });
    }
    showWin() {
        var winPanel = this.add.sprite(game.config.width/2, game.config.height/2 + 500, "win_bg");
        winPanel.setDepth(10);
        var rect = new Phaser.Geom.Rectangle(0, 0, game.config.width, game.config.height);
        var graphics = this.add.graphics({ fillStyle: { color: 0x000000 } });
        graphics.alpha = 0.85;
        graphics.fillRectShape(rect);
        // show panel
        this.tweens.add({
            targets: [winPanel],
            y: game.config.height/2 - 120,
            duration: 1000,
            ease: 'Back',
            callbackScope: this,
            onComplete: function(tween) {
                //
                var downloadBtn = this.add.sprite(game.config.width/2 + 50, game.config.height/2 + 40, 'btn_download').setInteractive();
                downloadBtn.setDepth(11);
                
                this.tweens.add({
                    targets: [downloadBtn],
                    y: game.config.height/2 + 40,
                    duration: 300
                })
                
                downloadBtn.on('pointerdown', function(pointer) {
                    // FbPlayableAd.onCTAClick();
                    // ExitApi.exit()
                    landingPage();
                }, this);
                downloadBtn.on('touchstart', function(pointer) {
                    // // FbPlayableAd.onCTAClick();
                    // ExitApi.exit()
                    landingPage();
                }, this);
                
                //
                var retryBtn = this.add.sprite(game.config.width/2 - 87, game.config.height/2 + 40, 'btn_retry').setInteractive();
                retryBtn.setDepth(11);
                retryBtn.on('pointerdown', function(pointer) {
                    this.scene.start("PlayGame")
                }, this);
                retryBtn.on('touchstart', function(pointer) {
                    this.scene.start("PlayGame")
                }, this);

               

                downloadBtn.scaleX = 0.8;
                downloadBtn.scaleY = 0.8;
                retryBtn.scaleX = 0.8;
                retryBtn.scaleY = 0.8;
                this.tweens.add({
                    targets: [ downloadBtn, retryBtn ],
                    scaleX: 1,
                    scaleY: 1,
                    duration: 250,
                    ease: 'Back'
                });
            }
        });
    }
    resize() {
        var canvas = document.querySelector("canvas");
        var windowWidth = window.innerWidth;
        var windowHeight = window.innerHeight;
        var windowRatio = windowWidth / windowHeight;
        var gameRatio = game.config.width / game.config.height;
        if (windowRatio < gameRatio) {
            canvas.style.width = windowWidth + "px";
            canvas.style.height = (windowWidth / gameRatio) + "px";
        }
        else {
            canvas.style.width = (windowHeight * gameRatio) + "px";
            canvas.style.height = windowHeight + "px";
        }
    }
}
